import React from "react";
import styled from "styled-components";
import { Note } from "./Note.js";
import { colors } from "./../colors.js";

export const Cell = (props) => {
  return (
    <StyledDiv className={props.data.set ? "set" : ""}>
      <Value className={props.data.val > 0 ? "show" : "hide"}>
        <div>{props.data.val}</div>
      </Value>
      <Notes>
        <Note
          num={1}
          show={props.data.notes[0]}
          animate={props.data.val != -1}
        />
        <Note
          num={2}
          show={props.data.notes[1]}
          animate={props.data.val != -1}
        />
        <Note
          num={3}
          show={props.data.notes[2]}
          animate={props.data.val != -1}
        />
        <Note
          num={4}
          show={props.data.notes[3]}
          animate={props.data.val != -1}
        />
        <Note
          num={5}
          show={props.data.notes[4]}
          animate={props.data.val != -1}
        />
        <Note
          num={6}
          show={props.data.notes[5]}
          animate={props.data.val != -1}
        />
        <Note
          num={7}
          show={props.data.notes[6]}
          animate={props.data.val != -1}
        />
        <Note
          num={8}
          show={props.data.notes[7]}
          animate={props.data.val != -1}
        />
        <Note
          num={9}
          show={props.data.notes[8]}
          animate={props.data.val != -1}
        />
      </Notes>
    </StyledDiv>
  );
};

Cell.defaultProps = {
  data: {
    val: -1,
    set: true,
    notes: [true, true, true, true, true, true, true, true, true],
  },
};

const StyledDiv = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;

  height: 100%;
  width: 100%;
  overflow: hidden;
  border: 1px solid ${colors.sudokuBorder};
  color: ${colors.sudokuFG};
  box-sizing: border-box;

  &.set {
    background-color: ${colors.sudokuSet};
  }
`;

const Value = styled.div`
  height: 100%;
  width: 100%;
  animation: pulse 1s ease-in-out;
  display: flex;
  justify-content: center;
  align-items: center;

  @keyframes pulse {
    50% {
      background-color: ${colors.sudokuFG};
      color: ${colors.sudokuBG1};
    }
  }

  &.hide {
  }
`;

const Notes = styled.div`
  display: grid;
  grid-template-rows: repeat(3, 1fr);
  grid-template-columns: repeat(3, 1fr);
  height: 100%;
  width: 100%;
`;
